import React from 'react';
import './App.css';
import {NavBar} from "./components/Navbar/NavBar";
import {Header} from "./components/Header/Header";
import {Dialogs} from "./components/profileContentComponents/Dialogs/Dialogs";
import {BrowserRouter, Route, Routes} from "react-router-dom";
import {ProfileContent} from "./components/profileContentComponents/ProfileContent";
import {News} from "./components/profileContentComponents/News/News";
import {Music} from "./components/profileContentComponents/Settings/Settings";
import {Settings} from "./components/profileContentComponents/Music/Music";


function App() {

    return (
        <BrowserRouter>
            <div className="app-wrapper">
                <Header/>
                <NavBar/>
                <div className="app-wrapper-content">
                    <Routes>
                        <Route path={'PROFILE'} element={<ProfileContent/>}/>
                        <Route path={'DIALOGS'} element={<Dialogs/>}/>
                        <Route path={'NEWS'} element={<News/>}/>
                        <Route path={'MUSIC'} element={<Music/>}/>
                        <Route path={'SETTINGS'} element={<Settings/>}/>
                    </Routes>
                </div>
            </div>
        </BrowserRouter>
    );

}


export default App;
